class Portfolio extends React.Component {
  state = {
    ports: [],
  };

  getPorts = () => {
    var axios = require('axios');

    var config = {
      method: 'get',
      url: 'https://webstoryboy.github.io/react5001/src/assets/json/portfolio.json',
      headers: { }
    };

    axios(config)
    .then(function (response) {
      console.log(JSON.stringify(response.data));
    })
    .catch(function (error) {
      console.log(error);
    });

  };

  componentDidMount() {
    this.getPorts();
  }

  render() {
    return (
      <>
        <Header />
        <Contents>
          <PortCont />
        </Contents>
        <Footer />
      </>
    );
  }
}

export default Portfolio;
